window.bookSummaryJSON = "<p>With the spellbinding crime fiction masterwork <i>Mistaken Identity</i>, Lisa Scottoline rocketed onto the <i>New York Times</i> best-seller list - and she's remained there ever since! </p> <p>A stunning tale of mystery and suspense, this classic from the beloved Edgar Award-winning author once again leads listeners down the gritty streets of Philadelphia and into the offices of the law firm of Rosato &amp; Associates. </p> <p>When a new client who's been accused of murder - and who bears an astonishing resemblance to Bennie Rosato - asks the crusading criminal defense attorney to take her case, Bennie finds herself entangled in a sticky web of murder, corruption, and violence that threatens to reveal the shocking truth about her own past. </p> <p>If you haven't listened to Lisa Scottoline before, <i>Mistaken Identity</i> will prove to you what her many fans already know: Nobody does it better! </p>"; 
